import React from "react";
import "../styles/SectionPage.css";
import image1 from "../assets/images/img1.png";
import image2 from "../assets/images/img2.png";
import image3 from "../assets/images/img3.png";
import image4 from "../assets/images/img4.png";

function SectionPage() {
    return (
        <main className="section-page-main">
            <div className="section-page-left">
                <h1>section title left ⤦</h1>
                <div className="image-wrapper">
                    <img className="image-normal" src={image1} alt="normal" />
                    <img className="image-hover" src={image2} alt="hover" />
                </div>
                <h3>subheading left</h3>
                <p>
                    description for the left section. <br />
                    more details here.
                </p>
            </div>
            <div className="section-page-right">
                <h1>section title right ˎˊ˗</h1>
                <div className="image-wrapper">
                    <img className="image-normal" src={image3} alt="normal" />
                    <img className="image-hover" src={image4} alt="hover" />
                </div>
                <h3>subheading right</h3>
                <p>
                    description for the right section. <br />
                    more details here.
                </p>
            </div>
        </main>
    );
}

export default SectionPage;
